import Sidebar from '../../components/sidebar/Sidebar';

import routes from '../../routes';
import logo from "../../assets/img/brand/argon-react.png";

function Dashboard() {
    return (
        <>
            <Sidebar
                routes={routes}
                logo={{
                    innerLink: "/",
                    imgSrc: logo,
                    imgAlt: "..."
                }} />
            <div
                className="main-content"
            ></div>
        </>
    )
}

export default Dashboard
